import React, { Component } from "react";
import { Modal } from "react-bootstrap";

class LikeShow extends Component {
  constructor(props) {
    super(props);

    this.state = {
      usernames: [],
      show: true,
    };
  }

  //   componentDidMount() {
  //     fetch(`http://127.0.0.1:8000/uapi/users/${this.props.user}/`, {
  //       method: "GET",
  //       headers: {
