  //       },
  //     })
  //       .then((resp) => resp.json())
  //       .then((res) => [res.username].concat(this.state.usernames))
  //       .catch((error) => console.log(error));
  //   }

  render() {
    return (
      <div>
        <Modal
          show={this.props.show}
          size="md"
          aria-labelledby="contained-modal-title-vcenter"
          centered
        >
          <Modal.Header
            closeButton
            onClick={() => {
              this.setState({ show: false });
            }}
          >
            <Modal.Title id="contained-modal-title-vcenter">
              Reactions
            </Modal.Title>
          </Modal.Header>
          <Modal.Body>
            {this.props.usernames.map((username) => {
              <h4>{username}</h4>;
            })}
          </Modal.Body>
          {/* <Modal.Footer></Modal.Footer> */}
        </Modal>
      </div>
    );
  }
}

export default LikeShow;
